import React from "react";
import styled from "styled-components";

const Container = styled.div`
  padding: 2rem;
`;

const ContactPage = () => {
  return (
    <Container>
      <h2>Contact Us</h2>
      <p>Email: contact@lokalnottoden.no</p>
    </Container>
  );
};

export default ContactPage;
